import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import { useAuth } from '../context/AuthContext';
import './Dashboard.css';

function Dashboard() {
  const { user } = useAuth();
  const [stats, setStats] = useState(null);
  const [recentCases, setRecentCases] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchDashboardData();
  }, []);

  const fetchDashboardData = async () => {
    try {
      const [statsRes, casesRes] = await Promise.all([
        axios.get('/api/cases/stats/overview'),
        axios.get('/api/cases?limit=5')
      ]);
      
      setStats(statsRes.data);
      setRecentCases(casesRes.data.cases.slice(0, 5));
      setLoading(false);
    } catch (error) {
      console.error('Error fetching dashboard data:', error);
      setLoading(false);
    }
  };

  if (loading) {
    return <div className="loading">Loading dashboard...</div>;
  }

  return (
    <div className="container">
      <div className="page-header">
        <h1>Welcome back, {user?.name}! ðŸ‘‹</h1>
        <p>Here's an overview of your law office</p>
      </div>

      <div className="stats-grid">
        <div className="stat-card">
          <div className="stat-icon">ðŸ“‚</div>
          <div className="stat-content">
            <h3>{stats?.totalCases || 0}</h3>
            <p>Total Cases</p>
          </div>
        </div>
        
        <div className="stat-card">
          <div className="stat-icon">ðŸ“‹</div>
          <div className="stat-content">
            <h3>{stats?.openCases || 0}</h3>
            <p>Open Cases</p>
          </div>
        </div>
        
        <div className="stat-card">
          <div className="stat-icon">âš¡</div>
          <div className="stat-content">
            <h3>{stats?.inProgressCases || 0}</h3>
            <p>In Progress</p>
          </div>
        </div>
        
        <div className="stat-card">
          <div className="stat-icon">âœ…</div>
          <div className="stat-content">
            <h3>{stats?.closedCases || 0}</h3>
            <p>Closed Cases</p>
          </div>
        </div>
      </div>

      <div className="dashboard-content">
        <div className="card">
          <div className="card-header flex-between">
            <h2>Recent Cases</h2>
            <Link to="/cases/new" className="btn btn-primary">+ New Case</Link>
          </div>
          
          {recentCases.length === 0 ? (
            <p>No cases found. Create your first case!</p>
          ) : (
            <table className="table">
              <thead>
                <tr>
                  <th>Case Number</th>
                  <th>Title</th>
                  <th>Client</th>
                  <th>Status</th>
                  <th>Priority</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                {recentCases.map(caseItem => (
                  <tr key={caseItem._id}>
                    <td>{caseItem.caseNumber}</td>
                    <td>{caseItem.title}</td>
                    <td>{caseItem.client?.firstName} {caseItem.client?.lastName}</td>
                    <td><span className={`badge badge-${caseItem.status.toLowerCase().replace(' ', '-')}`}>{caseItem.status}</span></td>
                    <td><span className={`badge badge-${caseItem.priority.toLowerCase()}`}>{caseItem.priority}</span></td>
                    <td>
                      <Link to={`/cases/${caseItem._id}`} className="btn btn-secondary">View</Link>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          )}
        </div>

        <div className="quick-actions">
          <h3>Quick Actions</h3>
          <div className="action-buttons">
            <Link to="/cases/new" className="action-btn">
              <span className="action-icon">ðŸ“„</span>
              <span>New Case</span>
            </Link>
            <Link to="/clients/new" className="action-btn">
              <span className="action-icon">ðŸ‘¤</span>
              <span>New Client</span>
            </Link>
            <Link to="/cases" className="action-btn">
              <span className="action-icon">ðŸ“Š</span>
              <span>View All Cases</span>
            </Link>
            <Link to="/clients" className="action-btn">
              <span className="action-icon">ðŸ‘¥</span>
              <span>View All Clients</span>
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
